	addi sp, sp, 4
	ret	# end LOADLEVEL
	
	
HUD: 
	addi sp, sp, -4	# begin HUD
	sw ra, 0(sp)
	
	jal TIMER
	jal SCORE
	jal LIVES
	
	lw ra, 0(sp)
	addi sp, sp, 4
	ret	#end HUD	
	
TIMER:
	addi sp, sp, -4	# begin TIMER
	sw ra, 0(sp)
	li a3, 0x07	# Timer color
	li a1, 2	# Timer horizontal psoition
	li a2, 14	# Timer vertical position
	
	li a7, 130
	ecall
	
	mv t2, a0
	li t3, -1	
	
	
	
	#######
	# calcula os decimal min passados
	
	sub a0, a0, s10
	li t0, 600000
	li t1, 6
	div a0, a0, t0
	rem a0, a0, t1
	
	
	li a7, 101
	mul a0, a0, t3
	ecall
	
	#######
	# calcula os unitario min passados
	mv a0, t2
	
	addi a1, a1, 8
	sub a0, a0, s10
	li t0, 60000
	li t1, 10
	div a0, a0, t0
	rem a0, a0, t1
	
	
	li a7, 101
	mul a0, a0, t3
	ecall
	
	#######
	# printa os doispontos
	la a0, colon
	li a7, 104
	addi a1, a1, 8
	ecall
	#######
	# calcula os decimais de segs passados
	mv a0, t2
	
	
	sub a0, a0, s10
	li t0, 10000
	li t1, 6
	div a0, a0, t0
	rem a0, a0, t1
	
	addi a1, a1, 8
	li a7, 101
	mul a0, a0, t3
	ecall
	
	#######
	# calcula os unidades de segs passados
	mv a0, t2
	
	
	sub a0, a0, s10
	li t0, 1000
	li t1, 10
	div a0, a0, t0
	rem a0, a0, t1
	
	addi a1, a1, 8
	li a7, 101
	mul a0, a0, t3
	ecall
	
	
	lw ra, 0(sp)
	addi sp, sp, 4
	ret	#end TIMER
	
SCORE:
	addi sp, sp, -4	# begin SCORE
	sw ra, 0(sp)
	
	li a3, 0x07	# score color
	li a1, 8	# score horizontal position
	li a2, 2	# score vertical position
	
	# texto
	la a0, pontostext
	li a7, 104
	ecall		# comenta essa linha
	
	# pontos
	addi a1, a1, 64	# e essa para remover o texto.
	mv a0, s5	# load points
	li a7, 101
	ecall
		
	lw ra, 0(sp)
	addi sp, sp, 4
	ret	#end SCORE
	
LIVES: 
	addi sp, sp, -4
	sw ra, 0(sp)
	
	li a3, 0x07	# lives color
	li a1, 248	# lives horizontal position
	li a2, 2	# lives vertical position
	la t0, PlayerVida
	
	# texto
	la a0, vidatext
	li a7, 104
	ecall
	
	# numVidas
	
	lw a0, 0(t0)
	addi a1, a1, 56
	li a7, 101
	ecall
	
	lw ra, 0(sp)
	addi sp, sp, 4
	ret	#end LIVES
	
BACKGROUND:
	addi sp, sp, -4	# begin BACKGROUND
	sw ra, 0(sp)
	
	la t0,scenary		# salva o descritor em $t0
	li t6,0xFF000000
	li t5,19199
	add t5,t5,t6
	addi t0,t0,8
LOOPL1:	
	bgt t6,t5,END_LEVEL1
	lw t1,0(t0)
	sw t1,0(t6)
	addi t6,t6,4
	addi t0,t0,4
	j LOOPL1
END_LEVEL1:		
	lw ra, 0(sp)
	addi sp, sp, 4
	
	ret
	
DrawPlayer:	# 20x24
	addi sp, sp, -4	# begin DrawPlayer
	sw ra, 0(sp)
	
	li a0, 1
	lw a1, 0(s1)
	lw a2, 4(s1)
	harry_print a0, a1, a2
	
	lw ra, 0(sp)
	addi sp, sp, 4
	ret		# end DrawPlayer
	
DrawBarrel:	# 20x24
	addi sp, sp, -4	# begin DrawBarrel
	sw ra, 0(sp)
	
	#desenha 1 barril
	lw a2, 4(s2)	# y pos do 1 barril, se for 0 nao tem barril.
	beq a2, zero, NoBarrel
	li a0, 1
	lw a1, 0(s2)
	barrel_print a0, a1, a2
	
	#desenha 2 barris
	lw a2, 16(s2)	# y pos do 2 barril, se for 0 nao tem barril.
	beq a2, zero, NoBarrel
	li a0, 1
	lw a1, 12(s2)
	barrel_print a0, a1, a2
	
NoBarrel:	lw ra, 0(sp)
	addi sp, sp, 4
	ret		# end DrawBarrel

	
GetCommand:
KEY: 	li t1,0xFF200000		# carrega o endereo de controle do KDMMIO
LOOP: 	lw t0,0(t1)			# Le bit de Controle Teclado
   	sw zero,0(t1)
   	andi t0,t0,0x0001		# mascara o bit menos significativo
   	beq t0,zero,EndCommand		# no tem tecla pressionada ento volta ao loop
   	lw a0,4(t1)			# le o valor da tecla
EndCommand:
	ret
	
CONTROLE: 

	######################
	# Keyboard ascii value
	# space = 0x00000020
	# d=0x00000064
	# a=0x00000061
	# w=0x00000077
	# s=0x00000073
	# p=0x00000000
	######################
	addi sp, sp, -4	# begin Controle
	sw ra, 0(sp)
	jal GetCommand	# gets an input and stores it in a0
	
	li t0, 0x00000020	# SPACE
	li t1, 0x00000064	# D key 
	li t2, 0x00000061	# A key
	li t3, 0x00000077	# W key 
	li t4, 0x00000073	# S key  
	
	lw ra, 0(sp)
	addi sp, sp, 4
	
	beq a0, t0, Jump
	beq a0, t1, PlayerMoveRight
	beq a0, t2, PlayerMoveLeft
	
	ret
	
GRAVIDADE:

	addi sp, sp, -4	# begin GRAVIDADE
	sw ra, 0(sp)
	
	
	# check for colision upper floor
	li t1, 128
	lw a2, 4(s1)
	addi a2, a2, 8
	beq a2, t1, Break
	# done checking
	
	# check for colision lower floor
	li t1, 200
	lw a2, 4(s1)
	addi a2, a2, 8
	beq a2, t1, Break
	# done checking
	
	
	
	lw a2, 4(s1)
	addi a2, a2, 8

	sw a2, 4(s1)
	
	lw ra, 0(sp)
	addi sp, sp, 4
	ret	# end GRAVIDADE
	
Jump:	
	addi sp, sp, -4	# begin Jump
	sw ra, 0(sp)
	
	bgt s3, zero, Break
	# check for mid air jump
	li t0, 120
	lw a2, 4(s1)
	blt a2, t0, Break
	# done checking
	
	li s3, 3	# altura do pulo
	li s4, 2	# quantos frames na altura maxima
	sound_jump
	
	lw ra, 0(sp)
	addi sp, sp, 4
	ret
	
CheckJump:
	addi sp, sp, -4	# begin CheckJump
	sw ra, 0(sp)
	
	beq s3, zero, Break
	
	li t1, 1
		
	beq s3, t1, MaxHeightHold
	
	addi s3, s3, -1
	
	lw a2, 4(s1)
	addi a2, a2, -16
	sw a2, 4(s1)
	
	lw ra, 0(sp)
	addi sp, sp, 4
	ret
	
MaxHeightHold:
	beq s4, zero, Break
	addi s4, s4, -1
	lw a2, 4(s1)
	addi a2, a2, -8
	sw a2, 4(s1)
	
	lw ra, 0(sp)
	addi sp, sp, 4
	ret
			
PlayerMoveRight:

	# check for out of bounds
	li t1, 312
	lw a1, 0(s1)
	addi a1, a1, 8
	bgt a1, t1, OutOfBoundsRight
	# end OFB check
	
	
	addi sp, sp, -4	# begin PlayerMoveRight
	sw ra, 0(sp)
	
	
	
	lw a1, 0(s1)
	addi a1, a1, 8
	sw a1, 0(s1)
	
	lw ra, 0(sp)
	addi sp, sp, 4
	ret
	
PlayerMoveLeft:

	# check for out of bounds
	li t1, 0
	lw a1, 0(s1)
	addi a1, a1, -8
	blt a1, t1, OutOfBoundsLeft
	# end OFB check
	
	
	addi sp, sp, -4	# begin PlayerMoveLeft
	sw ra, 0(sp)
	
	
	
	lw a1, 0(s1)
	addi a1, a1, -8
	sw a1, 0(s1)
	
	lw ra, 0(sp)
	addi sp, sp, 4
	ret

Break:
	#j UPDATE
	li s3, 0
	lw ra, 0(sp)
	addi sp, sp, 4
	ret
	
OutOfBoundsRight:
	
	li a1, 0
	sw a1, 0(s1)
	jal DrawPlayer
	
	j UPDATE
	
OutOfBoundsLeft:
	
		
	li a1, 312
	sw a1, 0(s1)
	jal DrawPlayer
	
	j UPDATE
	
ENDGAME:
	li a7, 110
	ecall

.include "SYSTEMv11.s"
